function PostContent(props) {
    return (
      <div>
        <h5 className="text-biome_text-darker text-sm mb-1"> Posted by u/{props.author} 5 hours ago: {props.postedAt}</h5>
        <h2 className="text-xl mb-3">{props.title}</h2>
        <div className="text-sm leading-6">
          {props.body}
        </div>
      </div>
    );
  }
  
  export default PostContent;
